function Home() {
  return (
    <div className="home-container">
      <h1>Welcome to My Portfolio</h1>

      <p><strong>Full-Stack Developer & Software Engineer | CS Graduate</strong></p>
      <p>
        I am a results-driven Computer Science graduate with over 2 years of professional experience as a Software Engineer, specializing in the design, development, and support of scalable web applications and enterprise systems.
        I bring strong proficiency in both front-end and back-end development using technologies such as <strong>HTML5, CSS3, Angular, React, Node.js, and SQL</strong>.
      </p>
      <p>
        I have engineered responsive and accessible user interfaces, contributed to secure banking platforms, and optimized backend workflows and API integrations.
        My strengths include <strong>project planning</strong>, <strong>system architecture</strong>, <strong>database design</strong>, and cross-functional collaboration in Agile environments.
      </p>
      <p>
        I am passionate about solving real-world problems through clean, efficient code and continuously improving system performance, reliability, and user satisfaction.
      </p>
    </div>
  );
}

export default Home;
